import React from 'react';
import logo from './login.png';
import './App.css';
import {AutoComplete} from 'antd';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <div className="container">
        <form className="box">BOX 範例</form>
        <h1>H1大小</h1>
        <h2>H2大小</h2>
        </div>
      </header>
    </div>
  );
}

export default App;
